import phones from "../../data/phone_list";
import lasPhones from "../../data/las_phones";

const getDeviceData = () => {
  let i = 0;
  let searchDevice = [];

  phones['phones'].forEach(phone => {
    const container = require(`../../data/phones/${phone}.json`);
    const changeName = container => !container ? "" : container

    const changeString = (container) => {
      try {return container}
      catch {return ""}
    }

    searchDevice.push([
      {
        key: i,
        type: "mac",
        data: changeString(container.resources[0].data.name.toUpperCase())
      },
      {
        key: i,
        type: "product",
        data: container.resources[0].data.product
      },
      {
        key: i,
        type: "user",
        data: changeString(container.resources[0].data.lines)
      },
      {
        key: i,
        type: "primary",
        data: changeString(container.resources[0].data.lines)
      },
      {
        key: i,
        type: "mask",
        data: changeString(container.resources[0].data.lines)
      },
      {
        key: i,
        type: "ip",
        data: changeString(container.resources[0].data.ip_address)
      },
      {
        key: i,
        type: "location",
        data: container.resources[0].meta.hierarchy.split("_").pop().toLowerCase()
      }
    ]);
  });

  lasPhones['devices'].forEach(device => {
    searchDevice.push([
      {
        key: i,
        type: "mac",
        data: device.mac
      },
      {
        key: i,
        type: "product",
        data: ""
      },
      {
        key: i,
        type: "user",
        data: device.user
      },
      {
        key: i,
        type: "line",
        data: device.line
      },
      {
        key: i,
        type: "mask",
        data: ""
      },
      {
        key: i,
        type: "ip",
        data: ""
      },
      {
        key: i,
        type: "location",
        data: "LAS"
      }
    ]);
  });

  i++;
  searchDevice.forEach(e => {if (!e[1].data) e[1].data = ""})

  return searchDevice;
};

export default getDeviceData();
